export class Home{
        helpdesk:number =0;
        order: number =0;
        account:number=0;
        facilitiesDesk:number = 0;
        space:number = 0;
        preventiveMaintenance:number = 0;
        constructor(){
                this.helpdesk = 0;
                this.order = 0;
                this.account = 0;
                this.facilitiesDesk = 0;
                this.space = 0;
                this.preventiveMaintenance = 0;
        }
}
